import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import LiftLog from './LiftLog';
import Modal from './Modal';
import Backdrop from './Backdrop';

const Workout = () => {

  const [newSetPopup, setNewSetPopup] = useState(true);
  const [isBlurred, setIsBlurred] = useState(true);

  return (
    <div id="workout-screen" className={isBlurred => "blurred"}>
      <Link to="/" class="upper-left">
        <button type="button" class="arrow-button">&larr;</button>
      </Link>
      <button type="button" class="upper-right button-underline">TIMES</button>
      <LiftLog />
        {newSetPopup && <Modal />}
        {newSetPopup && <Backdrop />}
    </div>
  );
}

export default Workout;
